    false,nt"url": null,nt"notes": "The 2015 TIGER Geodatabases are extracts
    of selected nation based and state based geographic and cartographic information
    from then                    U.S. Census Bureau's Master Address File/Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) database. The geodatabasesn
                       include feature class layers of information for the fifty states,
    the District of Columbia, Puerto Rico, and the Island areas (American Samoa, the
    n                    Commonwealth of the Northern Mariana Islands, Guam, and the
    United States Virgin Islands). The geodatabases do not contain any sensitive data.
    The n                    2015 TIGER Geodatabases are designed for use with Esriu2019s
    ArcGIS.n                    n                    The School Districts Geodatabase
    contains multiple nation based layers reflecting school district boundaries. These
    are the School District n                    u2013Elementary, School Districtu2013Secondary,School
    Districtu2013Unified and State layers.n                n                    School
    Districts are single-purpose administrative units within which local officials provide
    public educational services for the area's residents.n                    The Census
    Bureau obtains the boundaries, names, local education agency codes, grade ranges,
    and school district levels for school districts fromn                    State officials
    for the primary purpose of providing the U.S. Department of Education with estimates
    of the number of children in poverty withinn                    each school district.
     This information serves as the basis for the Department of Education to determine
    the annual allocation of Title I funding ton                    States and school
    districts. TIGER/Line Shapefiles include separate shapefiles for elementary, secondary
    and unified school districts. The schooln                    district boundaries
    are those in effect for the 2013-2014 school year.n                    n                    States
    and equivalent entities are the primary governmental divisions of the United States.n
